import React from 'react';

const FilmsListItem = ({film}) => {
    return (
        <div className="row">
            <div className="col-8">
                <p className="title">{film.title}</p>
                <p className="subtitle">{film.eng}</p>
            </div>
            <div className="col-2">
                <h3>{film.rating}</h3>
            </div>
        </div>
    )
}

export default FilmsListItem;
